css:
atom-text-editor,
:host {
  background-color: #2E3239;
  color: #eff1f5;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #343D46;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #3d464f;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #3d464f;
}
atom-text-editor.is-focused .cursor,
:host.is-focused .cursor {
  border-color: white;
}
atom-text-editor.is-focused.vim-mode.command-mode .cursor,
:host.is-focused.vim-mode.command-mode .cursor {
  background-color: white;
}
atom-text-editor.is-focused .cursor,
:host.is-focused .cursor,
atom-text-editor.is-focused.vim-mode.command-mode .cursor,
:host.is-focused.vim-mode.command-mode .cursor {
  transition: opacity 0.3s ease-in-out;
}
atom-text-editor.is-focused .cursor.blink-off,
:host.is-focused .cursor.blink-off,
atom-text-editor.is-focused.vim-mode.command-mode .cursor.blink-off,
:host.is-focused.vim-mode.command-mode .cursor.blink-off {
  visibility: visible;
  opacity: 0;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #2c3036;
  color: #65737e;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #343D46;
  color: #eff1f5;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #eff1f5;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #65737e;
}
atom-text-editor .invisible,
:host .invisible {
  color: #eff1f5;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #3d464f;
}
.comment {
  color: #65737e;
}
.entity.other.inherited-class {
  color: #a3be8c;
}
.entity.other.attribute-name {
  color: #d08770;
}
.entity.other.attribute-name.id {
  color: #8fa1b3;
}
.keyword {
  color: #b48ead;
}
.keyword.control {
  color: #b48ead;
}
.keyword.operator {
  color: #eff1f5;
}
.keyword.other.special-method {
  color: #8fa1b3;
}
.keyword.other.unit {
  color: #d08770;
}
.storage {
  color: #b48ead;
}
.constant {
  color: #d08770;
}
.constant.character.escape {
  color: #96b5b4;
}
.constant.numeric {
  color: #d08770;
}
.constant.other.color {
  color: #96b5b4;
}
.constant.other.symbol {
  color: #a3be8c;
}
.variable {
  color: #bf616a;
}
.variable.interpolation {
  color: #a9444e;
}
.variable.parameter.function {
  color: #eff1f5;
}
.invalid.illegal {
  background-color: #bf616a;
  color: #2E3239;
}
.string {
  color: #a3be8c;
}
.string.regexp {
  color: #96b5b4;
}
.string.regexp .source.ruby.embedded {
  color: #d08770;
}
.string.other.link {
  color: #bf616a;
}
.punctuation.definition.comment {
  color: #65737e;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #eff1f5;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #8fa1b3;
}
.punctuation.definition.bold {
  color: #ebcb8b;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b48ead;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #a9444e;
}
.support.class {
  color: #ebcb8b;
}
.support.function {
  color: #96b5b4;
}
.support.function.any-method {
  color: #8fa1b3;
}
.entity.name.function {
  color: #8fa1b3;
}
.entity.name.class,
.entity.name.type.class {
  color: #ebcb8b;
}
.entity.name.section {
  color: #8fa1b3;
}
.entity.name.tag {
  color: #bf616a;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #d08770;
}
.entity.other.attribute-name.id {
  color: #8fa1b3;
}
.meta.class {
  color: #ebcb8b;
}
.meta.link {
  color: #d08770;
}
.meta.require {
  color: #8fa1b3;
}
.meta.selector {
  color: #b48ead;
}
.meta.separator {
  background-color: #3d464f;
  color: #eff1f5;
}
.none {
  color: #eff1f5;
}
.markup.bold {
  color: #d08770;
  font-style: bold;
}
.markup.changed {
  color: #b48ead;
}
.markup.deleted {
  color: #bf616a;
}
.markup.italic {
  color: #b48ead;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #8fa1b3;
}
.markup.inserted {
  color: #a3be8c;
}
.markup.list {
  color: #bf616a;
}
.markup.quote {
  color: #d08770;
}
.markup.raw.inline {
  color: #a3be8c;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading.heading-1 {
  color: #ebcb8b;
}
.source.gfm .markup.heading.heading-2 {
  color: #bf616a;
}
.source.gfm .markup.heading.heading-3 {
  color: #a3be8c;
}
.source.gfm .markup.heading {
  color: #8fa1b3;
}
atom-text-editor[mini] .scroll-view,
:host(.mini) .scroll-view {
  padding-left: 1px;
}
